import React, { useEffect, useState } from "react";
import { StyleSheet, View, Image, Text } from "react-native";
import {
	NavigationContainer,
	useNavigationState,
} from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

import HomeStack from "../navigation/home-navigator";
import AccountStack from "../navigation/account-navigator";
import MySquad from "../screens/mySquad";
import Lists from "../screens/lists";
import { withOrientation } from "react-navigation";
import { useSelector } from "react-redux";

const Tab = createBottomTabNavigator();

const TabNav = () => {
	return (
		<Tab.Navigator tabBarOptions={{ showLabel: false }}>
			<Tab.Screen
				component={HomeStack}
				name="Home"
				options={{
					tabBarIcon: ({ focused }) => (
						<View style={styles.elements}>
							<Image
								source={require("../../assets/Ghost_face.png")}
								style={{
									tintColor: focused ? "#FF267C" : "#BDBDBD",
									width: 25,
									height: 25,
								}}
							></Image>
							<Text
								style={{
									color: focused ? "#FF267C" : "#BDBDBD",
									fontSize: 12,
									fontWeight: focused ? "500" : "normal",
								}}
							>
								Home
							</Text>
						</View>
					),
				}}
			/>

			<Tab.Screen
				component={Lists}
				name="My Lists"
				options={{
					tabBarIcon: ({ focused }) => (
						<View style={styles.elements}>
							<Image
								source={require("../../assets/Ghost_face.png")}
								style={{
									tintColor: focused ? "#FF267C" : "#BDBDBD",
									width: 25,
									height: 25,
								}}
							></Image>
							<Text
								style={{
									color: focused ? "#FF267C" : "#BDBDBD",
									fontSize: 12,
									fontWeight: focused ? "500" : "normal",
								}}
							>
								My Lists
							</Text>
						</View>
					),
				}}
			>
				{() => <Lists />}
			</Tab.Screen>
			<Tab.Screen
				name="Squad"
				component={MySquad}
				options={{
					tabBarIcon: ({ focused }) => (
						<View style={styles.elements}>
							<Image
								source={require("../../assets/Ghost_face.png")}
								style={{
									tintColor: focused ? "#FF267C" : "#BDBDBD",
									width: 25,
									height: 25,
								}}
							></Image>
							<Text
								style={{
									color: focused ? "#FF267C" : "#BDBDBD",
									fontSize: 12,
									fontWeight: focused ? "500" : "normal",
								}}
							>
								Squad
							</Text>
						</View>
					),
				}}
			/>
			<Tab.Screen
				name="Account"
				component={AccountStack}
				options={{
					tabBarIcon: ({ focused }) => (
						<View style={styles.elements}>
							<Image
								source={require("../../assets/Ghost_face.png")}
								style={{
									tintColor: focused ? "#FF267C" : "#BDBDBD",
									width: 25,
									height: 25,
								}}
							></Image>
							<Text
								style={{
									color: focused ? "#FF267C" : "#BDBDBD",
									fontSize: 12,
									fontWeight: focused ? "500" : "normal",
								}}
							>
								Account
							</Text>
						</View>
					),
				}}
			/>
		</Tab.Navigator>
	);
};

const styles = StyleSheet.create({
	nav: {
		color: "white",
	},
	elements: {
		alignItems: "center",
		justifyContent: "center",
	},
});

export default TabNav;
